I'm a man, and it took me nearly 15 years to come out publicly about being molested by my step-father over the course of several years during my childhood. I know EXACTLY the feelings and reasoning as to why women take so long to come forward, if they do at all about sexual assault and rape... These women have nothing to gain by coming forward and everything to 
lose. In my case he was a man in a position of power and influence in the town I lived in, and physically intimidating to boot. Even though people suspected what went on it was swept under the rug. So you can take your bullshit theories and disbelief and fuck off.
